import { ADD_BASIC, ADD_KEY_FEATURES, ADD_PIX, ADD_UP } from "../types/Form_types"

const initialState = {
  title: "",
  price: "",
  discount: "",
  raking : "",
  message : "",
  decription:"",
  keyFeatures: "",
  pictures: {

  }
}

export default (state = initialState, action) => {
  switch (action.type) {
    case ADD_BASIC:
      return state
    default:
      return state
  }
}
